script: |
  super -f text -I q9311.spq | sort > q9311.out

inputs:
  - name: q9311.spq
    data: |
      SELECT ALL - 26 - 11 + - ( + col2 ) * + + col2 + - + col1 * - + col0 - + col0 + + + col0 + - col0 + - col0 / col0 * - + col1 AS col0 FROM tab1 (FORMAT parquet) WHERE NULL NOT BETWEEN - - ( - col2 ) AND - 95 + - + col2;
  - name: tab1

outputs:
  - name: q9311.out
    data: |
